The first thing we could do to make our example application more interesting is to draw more than one widget. Unfortunately WindowDesc::new expects a function that returns only one Widget. We also need a way to tell Druid how to lay-out our widgets. We solve both these problems by passing in a widget-tree with one single widget at the top. Widgets can have children and widgets higher up in the tree know how to lay-out their children. That way we describe a window as a widget-tree with layout containers as the branches and widgets as the leaves. Our build_ui function is then responsible for building this widget tree. To see how this works we will divide our window in four. We'll have two rows and two columns with a single label in each of the quadrants. We can lay-out our labels using the Flex widget. fn build_ui() -> impl Widget<()> { Flex::row() .with_flex_child( Flex::column() .with_flex_child(Label::new("top left"), 1.0) .with_flex_child(Label::new("bottom left"), 1.0), 1.0) .with_flex_child( Flex::column() .with_flex_child(Label::new("top right"), 1.0) .with_flex_child(Label::new("bottom right"), 1.0), 1.0)
} This looks nice but the labels on the left are drawn right against the window edge, so we needs some padding. Lets say we also want to center the two bottom labels. Unlike many other UI frameworks, widgets in Druid don't have padding or alignment properties themselves. Widgets are kept as simple as possible. Features like padding or alignment are implemented in separate widgets. To add padding you simply wrap the labels in a Padding widget. Centering widgets is done using the Align widget set to centered. fn build_ui() -> impl Widget<()> { Padding::new( 10.0, Flex::row() .with_flex_child( Flex::column() .with_flex_child(Label::new("top left"), 1.0) .with_flex_child(Align::centered(Label::new("bottom left")), 1.0), 1.0) .with_child( Flex::column() .with_flex_child(Label::new("top right"), 1.0) .with_flex_child(Align::centered(Label::new("bottom right")), 1.0), 1.0))
} Do not forget to import the new widgets; use druid::widget::{Label, Flex, Padding, Align};

