You can think of a lens as a way of "focusing in" on one part of the data. You have a TodoItem, but you want a bool. Lens is a trait for types that perform this "focusing in" (aka lensing ). A simplified version of the Lens trait might look like this: trait SimpleLens<In, Out> { fn focus(&self, data: &In) -> Out;
} That is, this type takes an instance of In, and returns an instance of Out. For instance, imagine we wanted a lens to focus onto the completed state of our TodoItem. With our simple trait, we might do: /// This is the type of the lens itself; in this case it has no state.
struct CompletedLens; impl SimpleLens<TodoItem, bool> for CompletedLens { fn focus(&self, data: &TodoItem) -> bool { data.completed }
} Note : Lens isn't that helpful on its own; in druid it is generally used alongside LensWrap, which is a special widget that uses a Lens to change the Data type of its child. Lets say we have a Checkbox, but our data is a TodoItem: we can do, LensWrap::new(my_checkbox, CompletedLens) in order to bridge the gap. Our example is missing out on an important feature of lenses, though, which is that they allow mutations that occur on the lensed data to propagate back to the source. For this to work, lenses actually work with closures. The real signature of Lens looks more like this (names changed for clarity): pub trait Lens<In, Out> { /// Get non-mut access to the field. fn with<R, F: FnOnce(&Out) -> R>(&self, data: &In, f: F) -> R; /// Get mut access to the field. fn with_mut<R, F: FnOnce(&mut Out) -> R>(&self, data: &mut In, f: F) -> R;
} Here In refers to the input to the Lens and Out is the output. F is a closure that can return a result, R. Now, instead of just being passed Out directly from the function, we pass the function a closure that will itself be passed an Out; if our closure returns a result, that will be given back to us. This is unnecessary in the case of non-mutable access, but it is important for mutable access, because in many circumstances (such as when using an Rc or Arc) accessing a field mutably is expensive even if you don't do any mutation. In any case, the real implementation of our lens would look like, struct CompletedLens; impl Lens<TodoItem, bool> for CompletedLens { fn with<R, F: FnOnce(&bool) -> R>(&self, data: &TodoItem, f: F) -> R { f(&data.completed) } fn with_mut<R, F: FnOnce(&mut bool) -> R>(&self, data: &mut TodoItem, f: F) -> R { f(&mut data.completed) }
} That seems pretty simple and fairly annoying to write, which is why you generally don't have to.

