For simple field access, you can derive the Lens trait. /// A single todo item.
#[derive(Clone, Data, Lens)]
struct TodoItem { title: String, completed: bool, urgent: bool,
} This handles the boilerplate of writing a lens for each field. It also does something slightly sneaky: it exposes the generated lenses through the type itself, as associated constants. What this means is that if you want to use the lens that gives you the completed field, you can access it via TodoItem::completed. The generated code basically looks something like: struct GeneratedLens_AppData_title;
struct GeneratedLens_AppData_completed;
struct GeneratedLens_AppData_urgent; impl TodoItem { const title = GeneratedLens_AppData_title; const completed = GeneratedLens_AppData_completed; const urgent = GeneratedLens_AppData_urgent;
} One consequence of this is that if your type has a method with the same name as one of its fields, derive will fail. To get around this, you can specify a custom name for a field's lens: #[derive(Lens)]
struct Item { #[lens(name = "count_lens")] count: usize,
} // this now works
impl Item { fn count(&self) -> usize { self.count }
}

