The Painter widget lets you draw arbitrary custom content, but cannot respond to events or otherwise contain update logic. Its general use is to either provide a custom background to some other widget, or to implement something like an icon or another graphical element that will be contained in some other widget. For instance, if we had some color data and we wanted to display it as a swatch with rounded corners, we could use a Painter: fn make_color_swatch() -> Painter<Color> { Painter::new(|ctx: &mut PaintCtx, data: &Color, env: &Env| { let bounds = ctx.size().to_rect(); let rounded = bounds.to_rounded_rect(CORNER_RADIUS); ctx.fill(rounded, data); ctx.stroke(rounded, &env.get(druid::theme::PRIMARY_DARK), STROKE_WIDTH); })
} Painter uses all the space that is available to it; if you want to give it a set size, you must pass it explicit contraints, such as by wrapping it in a SizedBox : fn sized_swatch() -> impl Widget<Color> { SizedBox::new(make_color_swatch()).width(20.0).height(20.0)
} One other useful thing about Painter is that it can be used as the background of a Container widget. If we wanted to have a label that used our swatch as a background, we could do: fn background_label() -> impl Widget<Color> { Label::dynamic(|color: &Color, _| { let (r, g, b, _) = color.as_rgba_u8(); format!("#{:X}{:X}{:X}", r, g, b) }) .background(make_color_swatch())
} (This uses the background method on WidgetExt to embed our label in a container.)

