The Controller trait is sort of the inverse of Painter; it is a way to make widgets that handle events, but don't do any layout or drawing. The idea here is that you can use some Controller type to customize the behaviour of some set of children. The Controller trait has event, update, and lifecycle methods, just like Widget ; it does not have paint or layout methods. Also unlike Widget , all of its methods are optional; you can override only the method that you need. There's one other difference to the Controller methods; it is explicitly passed a mutable reference to its child in each method, so that it can modify it or forward events as needed. As an arbitrary example, here is how you might use a Controller to make a textbox fire some action (say doing a search) 300ms after the last keypress: const ACTION: Selector = Selector::new("hello.textbox-action");
const DELAY: Duration = Duration::from_millis(300); struct TextBoxActionController { timer: Option<TimerToken>,
} impl TextBoxActionController { pub fn new() -> Self { TextBoxActionController { timer: None } }
} impl Controller<String, TextBox> for TextBoxActionController { fn event( &mut self, child: &mut TextBox, ctx: &mut EventCtx, event: &Event, data: &mut String, env: &Env, ) { match event { Event::KeyDown(k) if k.key_code == KeyCode::Return => { ctx.submit_command(ACTION, None); } Event::KeyUp(k) if k.key_code != KeyCode::Return => { self.timer = Some(ctx.request_timer(DELAY)); child.event(ctx, event, data, env); } Event::Timer(token) if Some(*token) == self.timer => { ctx.submit_command(ACTION, None); } _ => child.event(ctx, event, data, env), } }
}

